import React from "react";


function Header() {
    return (
      <div>
        <header>
          <nav className='nav'>
            <img src={logo} className="App-logo" alt="logo" />
            <ul className='nav-items'>
              <li>Pricing</li>
              <li>About</li>
              <li>Contact</li>
            </ul>
          </nav>
        </header>
      </div>
    );
  }
